} Here is an example of how we will insert an entry in the Product entity using JavaScript on Node import { openAsBlob } from "node:fs" //node^19.8
import { readFile } from "node:fs/promises"
const form_data = new FormData()
const file = await openAsBlob('/path/to/image')
//Image upload can be done multiple ways
//import * as fs from "fs"
//const file = fs.createReadStream('/path/to/image')
form_data.append('image', file)
form_data.append('name', "Product name")
form_data.append('price', '1200')
form_data.append('description', 'Some description')
form_data.append('in_discount', 'true') fetch( 'https://api.yootcms.xyz/entities', { headers:{ "Authorization": "API_KEY_HERE" }, method:"POST", body: form_data }
)

