Send a POST request to the /entities endpoint. The request body must be a form data that contains the name of the entity and it's schema. If you don't know what a schema is please refer to this part of the documentation Entities . Here is an example using fetch in JavaScript const entity_name = "Product"
const schema = { "name":"Text", "price":"Number", "image":"Image", "description":"Text", "in_discount":"Boolean"
}
const form_data = new FormData()
form_data.append('name', entity_name)
form_data.append('schema', schema)
fetch( 'https://api.yootcms.xyz/entities', { headers:{ "Authorization": "API_KEY_HERE" }, method:"POST", body: form_data }
) YOOT will return status codes and specific error messages for you to know if the operation was successful or not. Check the Errors page for more information.

